/* Select the body element to set the background image */
body {
  /* Set the background image URL */
  background-image: url('https://www.google.com/url?sa=i&url=https%3A%2F%2Fin.pinterest.com%2Fpin%2Ftv-show-adventure-time-finn-adventure-time-jake-adventure-time-1080p-wallpaper-hdwall--709950328774512865%2F&psig=AOvVaw1hnxmoXY7FzrYp9s3mfgs1&ust=1705938212107000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCJiQkp3p7oMDFQAAAAAdAAAAABAQ');
  
  /* Set the background size to cover the entire viewport */
  background-size: cover;
  
  /* Center the background image */
  background-position: center;
  
  /* No repeat to prevent the image from being tiled */
  background-repeat: no-repeat;
  
  /* Optional: Add some styles to make text readable on the background */
  color: #ffffff; /* Set text color to white */
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.5); /* Add a subtle text shadow */
}

/* Optional: Reset margin and padding for the body to avoid spacing issues */
html, body {
  margin: 0;
  padding: 0;
}
